import React from "react"
import { ReactTable } from "react-table"
import "react-table/react-table.css"

const Table = ({ data }) => {
    const fRow = data[0];
    const columns = []
    for (let key in fRow) {
        columns.push({ Header: key, accessor:  key})  
    
    }

    return(
        <ReactTable
        className = "-striped -highlight"
        data = { data }
        columns = { columns }
        defaultPageSize = { 50 }
        />
    )
}

export default ReactTable
